import React from "react";
import NavBar from "./NavBar";
import Home from "./Home";
import Acm from "./Acm";
import Controller from "./Controller";
import Login from "./Login";
import AboutUs from "./AboutUs";
import { Switch } from "react-router";

const App = () => {
  return (
    <>
      <NavBar />
      <Switch>
        <Home />
        <Acm />
        <Controller />
        <AboutUs />
        <Login />
      </Switch>
    </>
  );
};
export default App;
